<html lang="en">

    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">

<style>
    body {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
    }
    .box {
        background-color: #EFE8B8;
        height: 500px;
        width: 750px;
        position: relative;
    }
    .box .layer {
        background-color: #643525;
        position: absolute;
        top: 2px;
        left: 2px;
        right: 2px;
        bottom: 2px;
    }
    .box .layer .side-line {
        position: absolute;
        top: 0px;
        left: 0px;
        right: 0px;
        bottom: 0px;
    }
    .box .layer .side-line .top .line-01 {
        position: absolute;
        height: 2px;
        top: 8px;
        left: 100px;
        right: 100px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .top .line-02 {
        position: absolute;
        height: 2px;
        top: 12px;
        left: 100px;
        right: 100px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .bottom .line-01 {
        position: absolute;
        height: 2px;
        bottom: 8px;
        left: 100px;
        right: 100px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .bottom .line-02 {
        position: absolute;
        height: 2px;
        bottom: 12px;
        left: 100px;
        right: 100px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .left .line-01 {
        position: absolute;
        width: 2px;
        top: 100px;
        bottom: 100px;
        left: 8px;
        background: linear-gradient(0deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .left .line-02 {
        position: absolute;
        width: 2px;
        top: 100px;
        bottom: 100px;
        left: 12px;
        background: linear-gradient(0deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .right .line-01 {
        position: absolute;
        width: 2px;
        top: 100px;
        bottom: 100px;
        right: 8px;
        background: linear-gradient(0deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .right .line-02 {
        position: absolute;
        width: 2px;
        top: 100px;
        bottom: 100px;
        right: 12px;
        background: linear-gradient(0deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .side-line .corner-top-left {
        position: absolute;
        top: 5px;
        left: 5px;
    }
    .box .layer .side-line .corner-top-right {
        position: absolute;
        top: 5px;
        right: 5px;
    }
    .box .layer .side-line .corner-bottom-right {
        position: absolute;
        bottom: 5px;
        right: 5px;
    }
    .box .layer .side-line .corner-bottom-left {
        position: absolute;
        bottom: 5px;
        left: 5px;
    }
    .box .layer .content {
        position: absolute;
        top: 50px;
        right: 20px;
        bottom: 50px;
        left: 20px;
    }
    .box .layer .content .light-background .top-line{
        border-radius: 50%;
        position: absolute;
        height: 1px;
        top: 0px;
        right: 80px;
        left: 80px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .content .light-background .bottom-line{
        border-radius: 50%;
        position: absolute;
        height: 1px;
        bottom: 0px;
        right: 80px;
        left: 80px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .content .light-background .left{
        position: absolute;
        top: 0px;
        right: 70%;
        bottom: 0px;
        left: 80px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,0.15) 100%);
    }
    .box .layer .content .light-background .center{
        position: absolute;
        top: 0px;
        right: 30%;
        bottom: 0px;
        left: 30%;
        background: rgba(255,248,217,0.15);
    }
    .box .layer .content .light-background .right{
        position: absolute;
        top: 0px;
        right: 80px;
        bottom: 0px;
        left: 70%;
        background: linear-gradient(270deg, rgba(255,248,217,0) 0%, rgba(255,248,217,0.15) 100%);
    }
    .box .layer .content .text {
        position: absolute;
        top: 0px;
        right: 0px;
        bottom: 0px;
        left: 0px;
        color: #fff8d9;
    }
    .box .layer .content .text p {
        text-align: center;
        font-family: "Bebas Neue", sans-serif;
        font-weight: 400;
        text-shadow: 0 0 10px #fff8d9;
        margin: 0px;
    }
    .box .layer .content .text .menu ul{
        padding: 0;
        width: 100%;
        list-style: none;
        display: inline-flex;
        flex-wrap: nowrap;
        justify-content: space-evenly;
        margin: 0px;
        align-items: center;
    }
    .box .layer .content .text .menu ul li {
        text-align: center;
        font-family: "Bebas Neue", sans-serif;
        font-weight: 400;
        font-size: 32px;
        margin: 3px 2px 2px;
        padding-top: 5px;
        width: 20%;
        line-height: 36px;
        cursor: default;
    }
    .box .layer .content .text .menu ul li:hover {
        background-color: rgba(255,248,217,0.3);
        border-radius: 2px;
        color: #643525;
    }
    .box .layer .content .text .menu ul li.active {
        background-color: rgba(255,248,217,1);
        border-radius: 2px;
        color: #643525;
    }
    .box .layer .content .text .header-title {
        margin-top: 5px;
    }
    .box .layer .content .text .line {
        border-radius: 50%;
        position: absolute;
        height: 1px;
        right: 80px;
        left: 80px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .font-32 {
        font-size: 32px;
    }
    .box .layer .content .text .table {
        position: absolute;
        top: 94px;
        right: 0;
        bottom: 0;
        left: 0;
    }
    .box .layer .content .text .table .cell-line-row {
        border-radius: 50%;
        position: absolute;
        height: 1px;
        right: 0px;
        left: 0px;
        background: linear-gradient(90deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .content .text .table .cell-line-col {
        border-radius: 50%;
        position: absolute;
        width: 1px;
        top: 0px;
        bottom: 0px;
        background: linear-gradient(0deg, rgba(255,248,217,0) 0%, rgba(255,248,217,1) 50%, rgba(255,248,217,0) 100%);
    }
    .box .layer .content .text .table .cell-line-row.r-01 {
        top: 25%;
    }
    .box .layer .content .text .table .cell-line-row.r-02 {
        top: 50%;
    }
    .box .layer .content .text .table .cell-line-row.r-03 {
        top: 75%;
    }
    .box .layer .content .text .table .cell-line-col.c-01 {
        left: 14%;
    }
    .box .layer .content .text .table .cell-line-col.c-02 {
        left: 26%;
    }
    .box .layer .content .text .table .cell-line-col.c-03 {
        left: 38%;
    }
    .box .layer .content .text .table .cell-line-col.c-04 {
        left: 50%;
    }
    .box .layer .content .text .table .cell-line-col.c-05 {
        left: 62%;
    }
    .box .layer .content .text .table .cell-line-col.c-06 {
        left: 74%;
    }
    .box .layer .content .text .table .cell-line-col.c-07 {
        left: 86%;
    }
</style>
